import React from 'react';
import ReactDOM from 'react-dom';
import 'tachyons';
import './index.css';
import CardList from './components/CardList';

import { users } from '../Users';

ReactDOM.render(
  <div>
    <CardList users={users} />,
  </div>,
  document.getElementById('root')
);
